/*Table structure for table `agency_tab` */

DROP TABLE IF EXISTS `agency_tab`;

CREATE TABLE `agency_tab` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `company_abbrev` varchar(10) CHARACTER SET latin1 DEFAULT NULL,
  `company_name` varchar(200) CHARACTER SET latin1 DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

