/*Table structure for table `approval_workflow` */

DROP TABLE IF EXISTS `approval_workflow`;

CREATE TABLE `approval_workflow` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_id` int(11) DEFAULT NULL COMMENT 'This is the ID of the employee id from employee_masterfile_tab',
  `approver_id` int(11) DEFAULT NULL COMMENT 'id of the Approver from employee_masterfile_tab',
  `hierarchy` int(11) DEFAULT NULL,
  `status` char(6) CHARACTER SET latin1 DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL COMMENT 'employee_id from employee_masterfile_tab',
  `date_created` date DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL COMMENT 'employee_id from employee_masterfile_tab',
  `date_updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `approval_workflow` */

/*Table structure for table `bday_greetings` */

