/*Table structure for table `employee_masterfile_tab` */

DROP TABLE IF EXISTS `employee_masterfile_tab`;

CREATE TABLE `employee_masterfile_tab` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `division_id` int(10) DEFAULT NULL,
  `department_id` int(11) DEFAULT NULL,
  `section_id` int(11) DEFAULT NULL,
  `status_id` int(11) DEFAULT NULL,
  `employee_no` varchar(10) NOT NULL,
  `position` varchar(40) DEFAULT NULL,
  `position_title` varchar(40) DEFAULT NULL,
  `specialist` tinyint(1) DEFAULT '0',
  `rank` int(2) DEFAULT NULL,
  `salary_level` varchar(4) DEFAULT NULL,
  `pay_grade` int(2) unsigned DEFAULT NULL,
  `pay_grade_old` int(2) DEFAULT NULL,
  `paycode` varchar(1) DEFAULT NULL,
  `cost_center` varchar(4) DEFAULT NULL,
  `shop_cost_center` varchar(4) DEFAULT NULL,
  `labor_cost_type` varchar(5) DEFAULT NULL,
  `isTeamCaptain` tinyint(1) DEFAULT '0',
  `effectivity_date` date DEFAULT NULL,
  `hired_date` date DEFAULT NULL,
  `probationary_date` date DEFAULT NULL,
  `regularization_date` date DEFAULT NULL,
  `last_promotion_date` date DEFAULT NULL,
  `separation_date` date DEFAULT NULL,
  `temporary_date` date DEFAULT NULL,
  `local_no` varchar(5) DEFAULT NULL,
  `pc_no` varchar(10) DEFAULT NULL,
  `last_user_id` varchar(15) DEFAULT NULL,
  `last_update` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `last_program` varchar(10) DEFAULT NULL,
  `isUpdated` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `employee_no` (`employee_no`)
