/*Data for the table `quotes` */

insert  into `quotes`(`id`,`quote`,`author`,`active`,`date_created`,`created_by`) values (1,'Opportunity is missed by most people because it is dressed in overalls and looks like work.','Thomas Edison',0,'2016-05-02 16:28:57',569),(2,'Choose a job you love, and you will never have to work a day in your life.','Confucius',0,'2016-05-02 16:31:23',569),(3,'The only place success comes before work is in the dictionary.','Vince Lombardi',0,'2016-05-02 16:33:26',569),(4,'Every noble work is at first impossible.','Thomas Carlyle',0,'2016-05-02 16:34:39',569),(5,'Whatever your life\'s work is, do it well. A man should do his job so well that the living, the dead, and the unborn could do it no better.','Martin Luther King, Jr.',0,'2016-05-02 16:35:01',569),(6,'Obstacles don\'t have to stop you. If you run into a wall, don\'t turn around and give up. Figure out how to climb it, go through it, or work around it.','Michael Jordan',0,'2016-05-02 16:38:10',569),(7,'Without ambition one starts nothing. Without work one finishes nothing. The prize will not be sent to you. You have to win it.','Ralph Waldo Emerson',0,'2016-05-02 16:47:58',569),(8,'Hide not your talents, they for use were made, What\'s a sundial in the shade?','Benjamin Franklin',0,'2016-05-02 16:50:40',569),(9,'Pleasure in the job puts perfection in the work.','Aristotle',0,'2016-05-02 16:50:38',569),(10,'The highest reward for man’s toil is not what he gets for it, but what he becomes by it.','John Ruskin',0,'2016-05-02 16:50:38',569),(11,'Professionalism: It\'s not the job you do, it\'s how you do your job.','Anonymous',0,'2016-05-02 16:50:40',569),(13,'Nothing worth having comes easy','Unknown',0,'0000-00-00 00:00:00',0),(14,'Great minds discuss ideas; average minds discuss events; small minds discuss people.','Eleanor Roosevelt',0,'0000-00-00 00:00:00',0),(15,'For God so loved the world that he gave his one and only Son, that whoever believes in him shall not perish but have eternal life.','John 3:16',1,'2018-04-17 11:04:21',1120),(16,'I have more understanding than all my teachers: for thy testimonies are my meditation.','Psalm 119:99',1,'2018-04-17 11:06:36',1120),(17,'Thy word is a lamp unto my feet, and a light unto my path.','Psalm 119:105',1,'2018-04-17 11:07:05',1120),(18,'Because it entereth not into his heart, but into the belly, and goeth out into the draught, purging all meats?','Mark 7:19',1,'2018-04-17 11:09:11',1120),(19,'Then Jesus told him, “Because you have seen me, you have believed; blessed are those who have not seen and yet have believed.”','John 20:29',1,'2018-04-17 11:13:24',1120),(20,'I can do all things through Christ who strengthens me.','Philippians 4:13',1,'2018-04-17 11:15:33',1120),(21,'Whether therefore ye eat, or drink, or whatsoever ye do, do all to the glory of God.','1 Corinthians 10:31',1,'2018-04-17 11:17:00',1120),(22,'Give generously to them and do so without a grudging heart; then because of this the LORD your God will bless you in all your work and in everything you put your hand to.','Deuteronomy 15:10',1,'2018-04-17 11:18:57',0),(23,'Do not take advantage of a hired worker who is poor and needy, whether that worker is a fellow Israelite or a foreigner residing in one of your towns. ','Deuteronomy 24:14',1,'0000-00-00 00:00:00',0),(24,'May the favor of the Lord our God rest on us; establish the work of our hands for us-yes, establish the work of our hands.','Psalm 90:17',1,'0000-00-00 00:00:00',0),(25,'You will eat the fruit of your labor; blessings and prosperity will be yours.','Psalm 128:2',1,'0000-00-00 00:00:00',0),(26,'Whatever your hand finds to do, do it with all your might, for in the realm of the dead, where you are going, there is neither working nor planning nor knowledge nor wisdom.','Ecclesiastes 9:10',1,'0000-00-00 00:00:00',0),(27,'For the Spirit God gave us does not make us timid, but gives us power, love and self-discipline.','2 Timothy 1:7',1,'0000-00-00 00:00:00',0),(28,'In everything I did, I showed you that by this kind of hard work we must help the weak, remembering the words the Lord Jesus himself said: ‘It is more blessed to give than to receive.’”','Acts 20:35',1,'0000-00-00 00:00:00',0),(29,'Therefore, my dear brothers and sisters, stand firm. Let nothing move you. Always give yourselves fully to the work of the Lord, because you know that your labor in the Lord is not in vain.','1 Corinthians 15:58',1,'0000-00-00 00:00:00',0),(30,'Whatever you do, work at it with all your heart, as working for the Lord, not for human masters, since you know that you will receive an inheritance from the Lord as a reward. It is the Lord Christ you are serving.','Colossians 3:23-24',1,'0000-00-00 00:00:00',0),(31,'A hard worker has plenty of food, but a person who chases fantasies has no sense.','Proverbs 12:11',1,'0000-00-00 00:00:00',0),(32,'For from him and through him and for him are all things. To him be the glory forever! Amen.','Romans 11:36',1,'0000-00-00 00:00:00',0);

