/*!50003 DROP PROCEDURE IF EXISTS  `sp_append_new_access` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_append_new_access`()
BEGIN
	INSERT INTO `user_access_tab`(`employee_id`,`system_id`,`user_type_id`,`last_user_id`,`last_update`)
	SELECT * FROM
	(SELECT t1.`id`,1 AS `system_id`,3 AS `user_type`,512 AS `last_user`,NOW() AS `last_update` FROM `employee_masterfile_tab` t1
	LEFT JOIN `user_access_tab` t2
	ON t1.`id` = t2.`employee_id`
	WHERE t2.`employee_id` IS NULL
	UNION ALL
	SELECT t1.`id`,2 AS `system_id`,3 AS `user_type`,512 AS `last_user`,NOW() AS `last_update` FROM `employee_masterfile_tab` t1
